import React from 'react';
import BlogPostTemplate from './BlogPostTemplate';
import blogheroimg from "./img/blogheroimg.jpg";

function BuyingAHome() {
    return (
        <div>
            <BlogPostTemplate blogpostImg={blogheroimg} />
        </div>
    )
}

export default BuyingAHome
